import{_ as a,a as r,b as d,c as i,d as o,e as l,f as h}from"./chunks/arm_10pin_jtag_connector_pinout.D6a9CP7n.js";import{_ as n,c as s,a8 as e,j as c,o as p}from"./chunks/framework.BDnHobkS.js";const x=JSON.parse('{"title":"3DR Pixhawk 1 비행 콘트롤러 (단종됨)","description":"","frontmatter":{},"headers":[],"relativePath":"ko/flight_controller/pixhawk.md","filePath":"ko/flight_controller/pixhawk.md"}'),b={name:"ko/flight_controller/pixhawk.md"};function u(m,t,k,f,g,w){return p(),s("div",null,t[0]||(t[0]=[e('<h1 id="_3dr-pixhawk-1-비행-콘트롤러-단종됨" tabindex="-1">3DR Pixhawk 1 비행 콘트롤러 (단종됨) <a class="header-anchor" href="#_3dr-pixhawk-1-비행-콘트롤러-단종됨" aria-label="Permalink to &quot;3DR Pixhawk 1 비행 콘트롤러 (단종됨)&quot;">​</a></h1><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>This flight controller has been <a href="./../flight_controller/autopilot_experimental.html">discontinued</a> and is no longer commercially available. You can use the <a href="./../flight_controller/mro_pixhawk.html">mRo Pixhawk</a> as a drop-in replacement.</p></div><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>PX4 does not manufacture this (or any) autopilot. 지원 또는 규정준수 문제는 제조업체에 문의하십시오.</p></div><p>The <em>3DR Pixhawk<sup>®</sup> 1</em> autopilot is a popular general purpose flight controller based on the <a href="https://pixhawk.org/" target="_blank" rel="noreferrer">Pixhawk-project</a> <strong>FMUv2</strong> open hardware design (it combines the functionality of the PX4FMU + PX4IO). It runs PX4 on the <a href="https://nuttx.apache.org/" target="_blank" rel="noreferrer">NuttX</a> OS.</p><p><img src="'+a+'" alt="Pixhawk Image"></p><p>Assembly/setup instructions for use with PX4 are provided here: <a href="./../assembly/quick_start_pixhawk.html">Pixhawk Wiring Quickstart</a></p><h2 id="주요-특징" tabindex="-1">주요 특징 <a class="header-anchor" href="#주요-특징" aria-label="Permalink to &quot;주요 특징&quot;">​</a></h2><ul><li>Main System-on-Chip: <a href="http://www.st.com/web/en/catalog/mmc/FM141/SC1169/SS1577/LN1789" target="_blank" rel="noreferrer">STM32F427</a><ul><li>CPU : 단정밀도 FPU의 180MHz ARM<sup>®</sup> Cortexex<sup>®</sup> M4</li><li>RAM : 256KB SRAM (L1)</li></ul></li><li>페일세이프 시스템 온칩 : STM32F100 <ul><li>CPU: 24 MHz ARM Cortex M3</li><li>RAM : 8KB SRAM</li></ul></li><li>Wifi: ESP8266 외장형</li><li>GPS: u-blox<sup>®</sup> 7/8 (Hobbyking<sup>®</sup>) / u-blox 6 (3D Robotics)</li><li>Optical flow: <a href="./../sensor/px4flow.html">PX4 Flow unit</a></li><li>중복 전원공급장치 및 자동 장애 조치</li><li>외부 안전 스위치</li><li>다색 LED 주시각 표시기</li><li>고전력 멀티톤 피에조 오디오 표시기</li><li>장기간 고속 로깅용 microSD 카드</li></ul><p>연결성</p><ul><li>I2C 1개</li><li>CAN 1개 (2개는 옵션)</li><li>ADC 1개</li><li>UART 4개 (흐름 제어 2개 포함)</li><li>콘솔 1개</li><li>수동 오버라이드 기능이 있는 PWM 8개</li><li>6개 PWM / GPIO / PWM 입력</li><li>S.BUS / PPM / Spektrum 입력</li><li>S.BUS 출력</li></ul><h1 id="구매처" tabindex="-1">구매처 <a class="header-anchor" href="#구매처" aria-label="Permalink to &quot;구매처&quot;">​</a></h1><p>원래 3DR®에서 제조하였습니다. 이 보드는 PX4®의 최초 표준 마이크로 콘트롤러 플랫폼이었습니다. While the board is no longer manufactured by 3DR, you can use the <a href="./../flight_controller/mro_pixhawk.html">mRo Pixhawk</a> as a drop-in replacement.</p><p>mRo Pixhawk 주문:</p><ul><li><a href="https://store.mrobotics.io/Genuine-PixHawk-1-Barebones-p/mro-pixhawk1-bb-mr.htm" target="_blank" rel="noreferrer">Bare Bones</a> - Just the board (useful as a 3DR Pixhawk replacement)</li><li><a href="https://store.mrobotics.io/Genuine-PixHawk-Flight-Controller-p/mro-pixhawk1-minkit-mr.htm" target="_blank" rel="noreferrer">mRo Pixhawk 2.4.6 Essential Kit</a> - includes everything except for telemetry radios</li><li><a href="https://store.mrobotics.io/product-p/mro-pixhawk1-fullkit-mr.htm" target="_blank" rel="noreferrer">mRo Pixhawk 2.4.6 Cool Kit! (Limited edition)</a> - includes everything you need including telemetry radios</li></ul><h2 id="사양" tabindex="-1">사양 <a class="header-anchor" href="#사양" aria-label="Permalink to &quot;사양&quot;">​</a></h2><h3 id="프로세서" tabindex="-1">프로세서 <a class="header-anchor" href="#프로세서" aria-label="Permalink to &quot;프로세서&quot;">​</a></h3><ul><li>32bit STM32F427 <a href="http://en.wikipedia.org/wiki/ARM_Cortex-M#Cortex-M4" target="_blank" rel="noreferrer">Cortex-M4F</a> core with FPU</li><li>168 MHz</li><li>256 KB RAM</li><li>2 MB Flash</li><li>32 비트 STM32F103 failsafe 코 프로세서</li></ul><h3 id="센서" tabindex="-1">센서 <a class="header-anchor" href="#센서" aria-label="Permalink to &quot;센서&quot;">​</a></h3><ul><li>ST Micro L3GD20H 3축 16비트 자이로스코프</li><li>ST 마이크로 LSM303D 14 비트 가속도계/자력계</li><li>Invensense MPU 6000 3축 가속도계/자이로스코프</li><li>MEAS MS5611 기압계</li></ul><h3 id="인터페이스" tabindex="-1">인터페이스 <a class="header-anchor" href="#인터페이스" aria-label="Permalink to &quot;인터페이스&quot;">​</a></h3><ul><li>UART (직렬 포트) 5개, 1 개의 고전력 지원, 2x (HW 흐름 제어 포함)</li><li>CAN 2개(하나는 내부 3.3V 트랜시버, 하나는 확장 커넥터에 있음)</li><li>Spektrum DSM/DSM2/DSM-X® Satellite 호환 입력</li><li>Futaba S.BUS® 호환 입력 및 출력</li><li>PPM 합계 신호 입력</li><li>RSSI(PWM 또는 전압) 입력</li><li>I2C</li><li>SPI</li><li>3.3 및 6.6V ADC 입력</li><li>내부 microUSB 포트 및 외부 microUSB 포트 확장</li></ul>',21),c("lite-youtube",{videoid:"gCCC5A-Bvv4",title:"PX4 Pixhawk (3DR) Multicolor Led in action"},null,-1),e('<h3 id="전력-시스템-및-보호" tabindex="-1">전력 시스템 및 보호 <a class="header-anchor" href="#전력-시스템-및-보호" aria-label="Permalink to &quot;전력 시스템 및 보호&quot;">​</a></h3><ul><li>자동 복구 기능의 이상적인 다이오드 컨트롤러</li><li>Servo rail high-power (max. 10V) and high-current (10A+) ready</li><li>모든 주변 장치 출력 과전류 보호, 모든 입력 ESD 보호</li></ul><h2 id="정격-전압" tabindex="-1">정격 전압 <a class="header-anchor" href="#정격-전압" aria-label="Permalink to &quot;정격 전압&quot;">​</a></h2><p>Pixhawk 는 3 개의 전원이 공급되는 경우에는 전원 공급 장치의 3중 중복이 가능합니다. 세 개의 레일은 전원 모듈 입력, 서보 레일 입력과 USB 입력입니다.</p><h3 id="정상-작동-최대-정격-전압" tabindex="-1">정상 작동 최대 정격 전압 <a class="header-anchor" href="#정상-작동-최대-정격-전압" aria-label="Permalink to &quot;정상 작동 최대 정격 전압&quot;">​</a></h3><p>이러한 조건에서 전원은 아래의 순서대로 시스템에 전원을 공급하여야합니다.</p><ul><li>전원 모듈 입력 (4.8V ~ 5.4V)</li><li>Servo rail input (4.8V to 5.4V) <strong>UP TO 10V FOR MANUAL OVERRIDE, BUT AUTOPILOT PART WILL BE UNPOWERED ABOVE 5.7V IF POWER MODULE INPUT IS NOT PRESENT</strong></li><li>USB 전원 입력 (4.8V ~ 5.4V)</li></ul><h3 id="절대-최대-정격-전압" tabindex="-1">절대 최대 정격 전압 <a class="header-anchor" href="#절대-최대-정격-전압" aria-label="Permalink to &quot;절대 최대 정격 전압&quot;">​</a></h3><p>아래의 조건에서 시스템은 전원을 사용하지 않지만(작동하지 않음), 그대로 유지됩니다.</p><ul><li>전원 모듈 입력(4.1V ~ 5.7V, 0V ~ 20V 손상되지 않음)</li><li>서보 레일 입력(4.1V ~ 5.7V, 0V ~ 20V)</li><li>USB 전원 입력(4.1V ~ 5.7V, 0V ~ 6V)</li></ul><h2 id="회로도" tabindex="-1">회로도 <a class="header-anchor" href="#회로도" aria-label="Permalink to &quot;회로도&quot;">​</a></h2><p><a href="https://raw.githubusercontent.com/PX4/Hardware/master/FMUv2/PX4FMUv2.4.5.pdf" target="_blank" rel="noreferrer">FMUv2 + IOv2 schematic</a> -- Schematic and layout</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>As a CC-BY-SA 3.0 licensed Open Hardware design, all schematics and design files are <a href="https://github.com/PX4/Hardware" target="_blank" rel="noreferrer">available</a>.</p></div><h2 id="연결" tabindex="-1">연결 <a class="header-anchor" href="#연결" aria-label="Permalink to &quot;연결&quot;">​</a></h2><p>Pixhawk ports are shown below. These use Hirose DF13 connectors (predating the JST-GH connectors defined in the Pixhawk connector standard).</p><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>Many 3DR Pixhawk clones use Molex picoblade connectors instead of DF13 connectors. They have rectangular instead of square pins, and cannot be assumed to be compatible.</p></div><p><img src="'+r+'" alt="Pixhawk Connectors"></p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>The <code>RC IN</code> port is for RC receivers only and provides sufficient power for that purpose. <strong>NEVER</strong> connect any servos, power supplies or batteries to it or to the receiver connected to it.</p></div><h2 id="핀배열" tabindex="-1">핀배열 <a class="header-anchor" href="#핀배열" aria-label="Permalink to &quot;핀배열&quot;">​</a></h2><h4 id="telem1-telem2-포트" tabindex="-1">TELEM1, TELEM2 포트 <a class="header-anchor" href="#telem1-telem2-포트" aria-label="Permalink to &quot;TELEM1, TELEM2 포트&quot;">​</a></h4><table tabindex="0"><thead><tr><th>핀</th><th>신호</th><th>전압</th></tr></thead><tbody><tr><td>1(red)</td><td>VCC</td><td>+5V</td></tr><tr><td>2 (흑)</td><td>TX (출력)</td><td>+3.3V</td></tr><tr><td>3 (흑)</td><td>RX (입력)</td><td>+3.3V</td></tr><tr><td>4 (흑)</td><td>CTS (입력)</td><td>+3.3V</td></tr><tr><td>5 (흑)</td><td>RTS (출력)</td><td>+3.3V</td></tr><tr><td>6 (흑)</td><td>GND</td><td>GND</td></tr></tbody></table><h4 id="gps-포트" tabindex="-1">GPS 포트 <a class="header-anchor" href="#gps-포트" aria-label="Permalink to &quot;GPS 포트&quot;">​</a></h4><table tabindex="0"><thead><tr><th>핀</th><th>신호</th><th>전압</th></tr></thead><tbody><tr><td>1(red)</td><td>VCC</td><td>+5V</td></tr><tr><td>2 (흑)</td><td>TX (출력)</td><td>+3.3V</td></tr><tr><td>3 (흑)</td><td>RX (입력)</td><td>+3.3V</td></tr><tr><td>4 (흑)</td><td>CAN2 TX</td><td>+3.3V</td></tr><tr><td>5 (흑)</td><td>CAN2 RX</td><td>+3.3V</td></tr><tr><td>6 (흑)</td><td>GND</td><td>GND</td></tr></tbody></table><h4 id="serial-4-5-포트" tabindex="-1">SERIAL 4/5 포트 <a class="header-anchor" href="#serial-4-5-포트" aria-label="Permalink to &quot;SERIAL 4/5 포트&quot;">​</a></h4><p>공간 제약으로 인하여 두 개의 포트가 하나의 커넥터에 있습니다.</p><table tabindex="0"><thead><tr><th>핀</th><th>신호</th><th>전압</th></tr></thead><tbody><tr><td>1(red)</td><td>VCC</td><td>+5V</td></tr><tr><td>2 (흑)</td><td>TX (#4)</td><td>+3.3V</td></tr><tr><td>3 (흑)</td><td>RX (#4)</td><td>+3.3V</td></tr><tr><td>4 (흑)</td><td>TX (#5)</td><td>+3.3V</td></tr><tr><td>5 (흑)</td><td>RX (#5)</td><td>+3.3V</td></tr><tr><td>6 (흑)</td><td>GND</td><td>GND</td></tr></tbody></table><h4 id="adc-6-6v" tabindex="-1">ADC 6.6V <a class="header-anchor" href="#adc-6-6v" aria-label="Permalink to &quot;ADC 6.6V&quot;">​</a></h4><table tabindex="0"><thead><tr><th>핀</th><th>신호</th><th>전압</th></tr></thead><tbody><tr><td>1(red)</td><td>VCC</td><td>+5V</td></tr><tr><td>2 (흑)</td><td>ADC 입력</td><td>최대 +6.6V</td></tr><tr><td>3 (흑)</td><td>GND</td><td>GND</td></tr></tbody></table><h4 id="adc-3-3v" tabindex="-1">ADC 3.3V <a class="header-anchor" href="#adc-3-3v" aria-label="Permalink to &quot;ADC 3.3V&quot;">​</a></h4><table tabindex="0"><thead><tr><th>핀</th><th>신호</th><th>전압</th></tr></thead><tbody><tr><td>1(red)</td><td>VCC</td><td>+5V</td></tr><tr><td>2 (흑)</td><td>ADC 입력</td><td>최대 +3.3V</td></tr><tr><td>3 (흑)</td><td>GND</td><td>GND</td></tr><tr><td>4 (흑)</td><td>ADC 입력</td><td>최대 +3.3V</td></tr><tr><td>5 (흑)</td><td>GND</td><td>GND</td></tr></tbody></table><h4 id="i2c" tabindex="-1">I2C <a class="header-anchor" href="#i2c" aria-label="Permalink to &quot;I2C&quot;">​</a></h4><table tabindex="0"><thead><tr><th>핀</th><th>신호</th><th>전압</th></tr></thead><tbody><tr><td>1(red)</td><td>VCC</td><td>+5V</td></tr><tr><td>2 (흑)</td><td>SCL</td><td>+3.3 (풀업)</td></tr><tr><td>3 (흑)</td><td>SDA</td><td>+3.3 (풀업)</td></tr><tr><td>4 (흑)</td><td>GND</td><td>GND</td></tr></tbody></table><h4 id="can" tabindex="-1">CAN <a class="header-anchor" href="#can" aria-label="Permalink to &quot;CAN&quot;">​</a></h4><table tabindex="0"><thead><tr><th>핀</th><th>신호</th><th>전압</th></tr></thead><tbody><tr><td>1(red)</td><td>VCC</td><td>+5V</td></tr><tr><td>2 (흑)</td><td>CAN_H</td><td>+12V</td></tr><tr><td>3 (흑)</td><td>CAN_L</td><td>+12V</td></tr><tr><td>4 (흑)</td><td>GND</td><td>GND</td></tr></tbody></table><h4 id="spi" tabindex="-1">SPI <a class="header-anchor" href="#spi" aria-label="Permalink to &quot;SPI&quot;">​</a></h4><table tabindex="0"><thead><tr><th>핀</th><th>신호</th><th>전압</th></tr></thead><tbody><tr><td>1(red)</td><td>VCC</td><td>+5V</td></tr><tr><td>2 (흑)</td><td>SPI_EXT_SCK</td><td>+3.3</td></tr><tr><td>3 (흑)</td><td>SPI_EXT_MISO</td><td>+3.3</td></tr><tr><td>4 (흑)</td><td>SPI_EXT_MOSI</td><td>+3.3</td></tr><tr><td>5 (흑)</td><td>!SPI_EXT_NSS</td><td>+3.3</td></tr><tr><td>6 (흑)</td><td>!GPIO_EXT</td><td>+3.3</td></tr><tr><td>7 (흑)</td><td>GND</td><td>GND</td></tr></tbody></table><h4 id="전원" tabindex="-1">전원 <a class="header-anchor" href="#전원" aria-label="Permalink to &quot;전원&quot;">​</a></h4><table tabindex="0"><thead><tr><th>핀</th><th>신호</th><th>전압</th></tr></thead><tbody><tr><td>1(red)</td><td>VCC</td><td>+5V</td></tr><tr><td>2 (흑)</td><td>VCC</td><td>+5V</td></tr><tr><td>3 (흑)</td><td>CURRENT</td><td>+3.3V</td></tr><tr><td>4 (흑)</td><td>VOLTAGE</td><td>+3.3V</td></tr><tr><td>5 (흑)</td><td>GND</td><td>GND</td></tr><tr><td>6 (흑)</td><td>GND</td><td>GND</td></tr></tbody></table><h4 id="스위치" tabindex="-1">스위치 <a class="header-anchor" href="#스위치" aria-label="Permalink to &quot;스위치&quot;">​</a></h4><table tabindex="0"><thead><tr><th>핀</th><th>신호</th><th>전압</th></tr></thead><tbody><tr><td>1(red)</td><td>VCC</td><td>+3.3V</td></tr><tr><td>2 (흑)</td><td>!IO_LED_SAFETY</td><td>GND</td></tr><tr><td>3 (흑)</td><td>SAFETY</td><td>GND</td></tr></tbody></table><h2 id="시리얼-포트-매핑" tabindex="-1">시리얼 포트 매핑 <a class="header-anchor" href="#시리얼-포트-매핑" aria-label="Permalink to &quot;시리얼 포트 매핑&quot;">​</a></h2><table tabindex="0"><thead><tr><th>UART</th><th>장치</th><th>포트</th></tr></thead><tbody><tr><td>UART1</td><td>/dev/ttyS0</td><td>IO 디버그</td></tr><tr><td>USART2</td><td>/dev/ttyS1</td><td>TELEM1 (흐름 제어)</td></tr><tr><td>USART3</td><td>/dev/ttyS2</td><td>TELEM2 (흐름 제어)</td></tr><tr><td>UART4</td><td></td><td></td></tr><tr><td>UART7</td><td>콘솔</td><td></td></tr><tr><td>UART8</td><td>SERIAL4</td><td></td></tr></tbody></table><h2 id="디버그-포트" tabindex="-1">디버그 포트 <a class="header-anchor" href="#디버그-포트" aria-label="Permalink to &quot;디버그 포트&quot;">​</a></h2><h3 id="콘솔-포트" tabindex="-1">콘솔 포트 <a class="header-anchor" href="#콘솔-포트" aria-label="Permalink to &quot;콘솔 포트&quot;">​</a></h3><p>The <a href="./../debug/system_console.html">PX4 System Console</a> runs on the port labeled <a href="#serial-4-5-port">SERIAL4/5</a>.</p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>A convenient way to connect to the console is to use a <a href="https://kb.zubax.com/display/MAINKB/Dronecode+Probe+documentation" target="_blank" rel="noreferrer">Dronecode probe</a>, as it comes with connectors that can be used with several different Pixhawk devices. Simply connect the 6-pos DF13 1:1 cable on the <a href="https://kb.zubax.com/display/MAINKB/Dronecode+Probe+documentation" target="_blank" rel="noreferrer">Dronecode probe</a> to the Pixhawk <code>SERIAL4/5</code> port.</p><p><img src="'+d+'" alt="Dronecode probe"></p></div><p>The pinout is standard serial pinout, designed to connect to a <a href="https://www.digikey.com/en/products/detail/TTL-232R-3V3/768-1015-ND/1836393" target="_blank" rel="noreferrer">3.3V FTDI</a> cable (5V tolerant).</p><table tabindex="0"><thead><tr><th>3DR Pixhawk 1</th><th></th><th>FTDI</th><th></th></tr></thead><tbody><tr><td>1</td><td>+5V (적)</td><td></td><td>N/C</td></tr><tr><td>2</td><td>S4 Tx</td><td></td><td>N/C</td></tr><tr><td>3</td><td>S4 Rx</td><td></td><td>N/C</td></tr><tr><td>4</td><td>S5 Tx</td><td>5</td><td>FTDI RX (황)</td></tr><tr><td>5</td><td>S5 Rx</td><td>4</td><td>FTDI TX (적황)</td></tr><tr><td>6</td><td>GND</td><td>1</td><td>FTDI GND (흑)</td></tr></tbody></table><p>6 핀 DF13 1 : 1 커넥터에 대한 FTDI 케이블의 배선은 아래 그림과 같습니다.</p><p><img src="'+i+'" alt="Console Connector"></p><p>전체 배선은 아래와 같습니다.</p><p><img src="'+o+'" alt="Console Debug"></p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>For information on how to <em>use</em> the console see: <a href="./../debug/system_console.html">System Console</a>.</p></div><h3 id="swd-포트" tabindex="-1">SWD 포트 <a class="header-anchor" href="#swd-포트" aria-label="Permalink to &quot;SWD 포트&quot;">​</a></h3><p>The <a href="./../debug/swd_debug.html">SWD</a> (JTAG) ports are hidden under the cover (which must be removed for hardware debugging). 아래에 강조 표시된 것처럼 FMU와 IO를 위한 별도의 포트가 존재합니다.</p><p><img src="'+l+'" alt="Pixhawk SWD"></p><p>포트는 ARM 10핀 JTAG 커넥터이므로 납땜이 필요합니다. 포트의 핀배열은 아래와 같습니다(위 모서리의 사각형 마커는 핀 1을 나타냄).</p><p><img src="'+h+'" alt="ARM 10-Pin connector pinout"></p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>All Pixhawk FMUv2 boards have a similar SWD port.</p></div><h2 id="펌웨어-빌드" tabindex="-1">펌웨어 빌드 <a class="header-anchor" href="#펌웨어-빌드" aria-label="Permalink to &quot;펌웨어 빌드&quot;">​</a></h2><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Most users will not need to build this firmware! It is pre-built and automatically installed by <em>QGroundControl</em> when appropriate hardware is connected.</p></div><p>To <a href="./../dev_setup/building_px4.html">build PX4</a> for this target:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>make px4_fmu-v2_default</span></span></code></pre></div><h2 id="부품-하우징" tabindex="-1">부품 / 하우징 <a class="header-anchor" href="#부품-하우징" aria-label="Permalink to &quot;부품 / 하우징&quot;">​</a></h2><ul><li><strong>ARM MINI JTAG (J6)</strong>: 1.27 mm 10pos header (SHROUDED), for Black Magic Probe: FCI 20021521-00010D4LF (<a href="https://www.distrelec.ch/en/minitek-127-straight-male-pcb-header-surface-mount-rows-10-contacts-27mm-pitch-amphenol-fci-20021521-00010d4lf/p/14352308" target="_blank" rel="noreferrer">Distrelec</a>, <a href="https://www.digikey.com/en/products/detail/20021521-00010T1LF/609-4054-ND/2414951" target="_blank" rel="noreferrer">Digi-Key</a>,) or Samtec FTSH-105-01-F-DV-K (untested) or Harwin M50-3600542 (<a href="https://www.digikey.com/en/products/detail/harwin-inc/M50-3600542/2264370" target="_blank" rel="noreferrer">Digikey</a> or <a href="http://ch.mouser.com/ProductDetail/Harwin/M50-3600542/?qs=%2fha2pyFadujTt%2fIEz8xdzrYzHAVUnbxh8Ki%252bwWYPNeEa09PYvTkIOQ%3d%3d" target="_blank" rel="noreferrer">Mouser</a>) <ul><li>JTAG Adapter Option #1: <a href="https://1bitsquared.com/products/black-magic-probe" target="_blank" rel="noreferrer">BlackMagic Probe</a>. 케이블 없이 제공될 수 있습니다 (제조업체에 확인). If so, you will need the <strong>Samtec FFSD-05-D-06.00-01-N</strong> cable (<a href="https://www.samtec.com/products/ffsd-05-d-06.00-01-n" target="_blank" rel="noreferrer">Samtec sample service</a> or <a href="http://www.digikey.com/product-search/en?x=0&amp;y=0&amp;lang=en&amp;site=us&amp;KeyWords=FFSD-05-D-06.00-01-N" target="_blank" rel="noreferrer">Digi-Key Link: SAM8218-ND</a>) or <a href="http://www.tag-connect.com/CORTEXRIBBON10" target="_blank" rel="noreferrer">Tag Connect Ribbon</a> and a Mini-USB cable.</li><li>JTAG Adapter Option #2: <a href="https://www.digikey.com/product-detail/en/stmicroelectronics/ST-LINK-V2/497-10484-ND" target="_blank" rel="noreferrer">Digi-Key Link: ST-LINK/V2</a> / <a href="http://www.st.com/internet/com/TECHNICAL_RESOURCES/TECHNICAL_LITERATURE/USER_MANUAL/DM00026748.pdf" target="_blank" rel="noreferrer">ST USER MANUAL</a>, needs an ARM Mini JTAG to 20pos adapter: <a href="https://www.digikey.com/en/products/detail/texas-instruments/MDL-ADA2/1986451" target="_blank" rel="noreferrer">Digi-Key Link: 726-1193-ND</a></li><li>JTAG Adapter Option #3: <a href="http://www.sparkfun.com/products/8278" target="_blank" rel="noreferrer">SparkFun Link: Olimex ARM-TINY</a> or any other OpenOCD-compatible ARM Cortex JTAG adapter, needs an ARM Mini JTAG to 20pos adapter: <a href="https://www.digikey.com/en/products/detail/texas-instruments/MDL-ADA2/1986451" target="_blank" rel="noreferrer">Digi-Key Link: 726-1193-ND</a></li></ul></li><li><strong>USARTs</strong>: Hirose DF13 6 pos (<a href="https://www.digikey.com/products/en?keywords=H3371-ND" target="_blank" rel="noreferrer">Digi-Key Link: DF13A-6P-1.25H(20)</a>) <ul><li>Mates: Hirose DF13 6 pos housing (<a href="https://www.digikey.com/products/en?keywords=H2182-ND" target="_blank" rel="noreferrer">Digi-Key Link: Hirose DF13-6S-1.25C</a>)</li></ul></li><li><strong>I2C and CAN</strong>: Hirose DF13 4 pos (<a href="https://www.digikey.com/en/products/detail/hirose-electric-co-ltd/DF13A-4P-1-25H-20/530666" target="_blank" rel="noreferrer">Digi-Key Link: DF13A-4P-1.25H(20)</a> - discontinued)</li></ul><h2 id="지원-플랫폼-및-기체" tabindex="-1">지원 플랫폼 및 기체 <a class="header-anchor" href="#지원-플랫폼-및-기체" aria-label="Permalink to &quot;지원 플랫폼 및 기체&quot;">​</a></h2><p>일반 RC 서보 또는 Futaba S-Bus 서보로 제어 가능한 모든 멀티콥터/비행기/로버 또는 보트.</p>',67)]))}const S=n(b,[["render",u]]);export{x as __pageData,S as default};
